import React from 'react';
import './App.css';
import Page404 from './components/404';
import BBCNews from './components/BBC News';
import Home from './components/Home';
import { BrowserRouter as Router,Route, Routes } from 'react-router-dom'
import 'bootstrap/dist/css/bootstrap.min.css';

import { Navbar, Container, Nav } from 'react-bootstrap'
function App() {
  return(  
  <Router>
    <div id='news-app'>
      <Navbar expand='lg' variant='dark' bg='dark'>
        <Container>
        <Navbar.Brand as="/home">News App</Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
        <Nav className='me-auto'>
          <Nav.Link as="/home">Home</Nav.Link>
          <Nav.Link as="/BBCNews">BBC News</Nav.Link>
          <Nav.Link as={Link}>Page404</Nav.Link>
        </Nav>
          <Routes>
            <Route exact path='/' element={<Home />} />
            <Route exact path='/BBCNews' element={<BBCNews />} />
            <Route exact path='/Page404' element={<Page404 />} />
            </Routes>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </div>
  </Router>
  );
}

export default App;
